import "./Nav.css";
import React from "react";
import { Link } from "react-router-dom";

export default class Nav extends React.Component {
  render() {
    return (
      <ul>
        <li>
          <Link>Hi</Link>
        </li>
        <li>
          <Link>Hello</Link>
        </li>
        <li>
          <Link>Howdy</Link>
        </li>
      </ul>
    );
  }
}
